/** 
 * returns the appropriate number of format digits for a legend value
 * @param delta
 * @param bonus - additional digits
 * @return
 */
public static int getLegendFormatDigits(float step,int bonus){
  if (step < 0.0000099) {
    return 6 + bonus;
  }
 else   if (step < 0.000099) {
    return 5 + bonus;
  }
 else   if (step < 0.00099) {
    return 4 + bonus;
  }
 else   if (step < 0.0099) {
    return 3 + bonus;
  }
 else   if (step < 0.099) {
    return 2 + bonus;
  }
 else   if (step < 0.99) {
    return 1 + bonus;
  }
 else {
    return 0 + bonus;
  }
}
